  CONSTRAINT `order_list_ibfk_1` FOREIGN KEY (`order_transactions_id`) REFERENCES `order_transactions` (`id`),
  CONSTRAINT `order_list_ibfk_2` FOREIGN KEY (`menu_items_id`) REFERENCES `menu_items` (`id`),
  CONSTRAINT `order_list_ibfk_3` FOREIGN KEY (`special_request_id`) REFERENCES `special_request` (`id`),
  CONSTRAINT `order_list_ibfk_4` FOREIGN KEY (`request_type_id`) REFERENCES `request_type` (`id`)
